import { useContext } from "react";
import { CDN_URL } from "../utils/constants";
import UserContext from "../utils/UserContext";

const IMAGE_MAP = {
    '123456' : 'data:image/jpeg;base64,',
    '234567' : 'data:image/jpeg;base64,',
    '345678' : 'data:image/jpeg;base64,',
    '456789' : 'data:image/jpeg;base64,',
    '567890' : 'data:image/jpeg;base64,',
    '678901' : 'data:image/jpeg;base64,',
    '789012' : 'data:image/jpeg;base64,',
    '890123' : 'data:image/jpeg;base64,',
    '901234' : 'data:image/jpeg;base64,'
}

const RestaurantCard = (props) => {
    const { resData } = props;
    const {loggedInUser} = useContext(UserContext);

    const {
        cloudinaryImageId,
        name, 
        cuisines, 
        avgRating, 
        costForTwo, 
        sla
    } = resData?.info;

    return (
        <div className="m-4 p-4 w-[250px] rounded-lg bg-gray-200 hover:bg-gray-400" >
            <img 
                className="rounded-lg"
                alt="res-logo" 
                src={IMAGE_MAP[resData.info.id]}
            />
            <h3 className="font-bold py-4 text-xl">{name}</h3>
            <h4>{cuisines.join(", ")}</h4>
            <h4>{avgRating} stars</h4>
            <h4>{costForTwo}</h4>
            <h4>{sla?.slaString}</h4>
            <h4>User : {loggedInUser}</h4>
            
        </div>
    )
}

export default RestaurantCard;